import React from "react";
import Link from "./Link";
import { Cards, GithubLogo, LinkedinLogo, TwitterLogo } from "@phosphor-icons/react";

export default function LinkList() {
    const links = [
        {
            title: "GitHub",
            link: "https://github.com/wesleybertipaglia",
            icon: {GithubLogo},
            bg: "bg-slate-800",
            color: "text-white"
        },
        {
            title: "Portfolio",
            link: "https://wesleybertipaglia.github.io/portfolio/",
            icon: {Cards},
            bg: "bg-cyan-500",
            color: "text-white"
        },
        {
            title: "Youtube",
            link: "https://github.com/wesleybertipaglia"
        },
        {
            title: "LinkedIn",
            link: "https://www.linkedin.com/in/wesley-bertipaglia/",
            icon: {LinkedinLogo},
            bg: "bg-indigo-500",
            color: "text-white"
        },
        {
            title: "Instagram",
            link: "https://www.instagram.com/wesleyberti_"
        },
        {
            title: "Twitter",
            link: "https://twitter.com/wesleyberti_",
            icon: {TwitterLogo},
            bg: "bg-sky-500",
            color: "text-white"
        }
    ]

    return (
        <section className="w-full">
            <div className="flex flex-col gap-6 p-6">
                <Link 
                    title="Portfolio" 
                    link="https://wesleybertipaglia.github.io/portfolio/#"
                    icon={Cards}
                    bg="bg-cyan-500"
                    color="text-white"
                />

                {
                    links.map((item) = () => {
                        <Link />
                    })
                }
            </div>
        </section>
    )
}
